create table items_pets
(
    Id                    int          not null,
    Name                  varchar(255) null,
    FoodItemsCSV          mediumtext   null,
    FoodTypesCSV          mediumtext   null,
    MinDurationBeforeMeal int          null,
    MaxDurationBeforeMeal int          null,
    PossibleEffectsBin    longblob     null,
    GhostItemId           int          null,
    CertificateItemId     int          null,
    LookString            mediumtext   null
)
    engine = MyISAM
    charset = utf8;

